    <script>// Pandoc 2.9 adds attributes on both header and div. We remove the former (to
// be compatible with the behavior of Pandoc < 2.8).
document.addEventListener('DOMContentLoaded', function(e) {
  var hs = document.querySelectorAll("div.section[class*='level'] > :first-child");
  var i, h, a;
  for (i = 0; i < hs.length; i++) {
    h = hs[i];
    if (!/^h[1-6]$/i.test(h.tagName)) continue;  // it should be a header h1-h6
    a = h.attributes;
    while (a.length > 0) h.removeAttribute(a[0].name);
  }
});

    /* https://github.com/nuclei/readyjs */

      el.textContent.trim()
    )

    function inRevealjs () {
      return typeof window.Reveal !== 'undefined'
    }

    function inRemarkjs () {
      return typeof window.remark !== 'undefined'
    }

    function inRemarkSlide (el) {
      return inRemarkjs() && el.closest('.remark-slide')
    }

    const panelIds = {}
    let panelsetIdx = 0
    const panelsetIds = []

    /**
     * Generates a unique panelset ID.
     * @param {string} id - The optional ID to be used as a base for the panelset ID.
     * @returns {string} - The generated unique panelset ID.
     */
    const uniquePanelsetId = id => {
      const panelsetNumber = () => (++panelsetIdx).toString().padStart(3, '0')

      if (typeof id === 'undefined' || id === '') {
        id = 'panelset_' + panelsetNumber()
      } else if (panelsetIds.includes(id)) {
        id = id + '_' + panelsetNumber()
      }

      panelsetIds.push(id)
      return id
    }

    /**
     * Generates a unique panel ID based on the provided name, by appending an
     * increasing integer to the name to make it unique.
     *
     * @param {string} name - The name to generate the panel ID from.
     * @returns {string} The unique panel ID.
     */
    const uniquePanelId = name => {
      name = encodeURIComponent(name.toLowerCase().replace(/[\s]/g, '-'))
      if (Object.keys(panelIds).includes(name)) {
        name += ++panelIds[name]
      } else {
        panelIds[name] = 1
      }
      return name

     * Identifies the panel name based on the given item, taking into account
     * the various ways that panel names can be specified in R Markdown, Quarto,
     * or revealjs.

     * @param {HTMLElement} item - The item to identify the panel name from.
     * @returns {string} The identified panel name or undefined if no name can
     * be identified.
     */
    const identifyPanelName = item => {
      let name = 'Panel'

      // If the item doesn't have a parent element, then we've already processed
      // it, probably because we're in an Rmd, and it's been removed from the DOM
      if (!item.parentElement) {
        return
      }

      if (item.matches('.panel')) {
        if (item.dataset.name) return item.dataset.name
        if (item.getAttribute('name')) return item.getAttribute('name')
      }

      // In R Markdown when header-attrs.js is present, we may have found a
      // section header but the class attributes won't be duplicated on the <hX> tag

        /^H[1-6]/.test(item.children[0].tagName)

        name = item.children[0].textContent
        item.classList.remove('panel-name')
        item.removeChild(item.children[0])
        return name

      if (!nameDiv) return name

      // In remarkjs the .panel-name span might be in a paragraph tag
      // and if the <p> is empty, we'll remove it
      if (
        nameDiv.tagName === 'SPAN' &&
        nameDiv.parentNode.tagName === 'P' &&
        nameDiv.textContent === nameDiv.parentNode.textContent

        item.removeChild(nameDiv.parentNode)
        return name

      nameDiv.parentNode.removeChild(nameDiv)

     * panel the item will become.

     * id, active status, and other attributes. Returns null if the panel name
     * cannot be identified.

      if (!name) {

      }

        name,
        content: item.children,
        id: uniquePanelId(name),

     * @param {string} panelsetId - The ID of the panelset.

     * 2. If there is an active panel, use the ID of the first active panel.
     * 3. Use the ID of the first panel in the array.

     * group, the group state will be updated after the initial panelset is
     * created.
     *

     * @returns {string} - The ID of the initial selected panel.
     */

      const panelIds = panels.map(p => p.id)

      const panelSelectedUrl = getCurrentPanelFromUrl(panelsetId)
      if (panelSelectedUrl && panelIds.includes(panelSelectedUrl)) {
        return panelSelectedUrl
      }

      const panelsActive = panels.filter(p => p.active)
      if (panelsActive.length) {
        return panelsActive[0].id
      }

      return panels[0].id

      res.id = uniquePanelsetId(id)
      res.style.cssText = style
      if (dataset) {

        })
      }

      headerRow.className = 'panel-tabs'
      headerRow.setAttribute('role', 'tablist')
      panels

          const panelHeaderItem = document.createElement('li')
          panelHeaderItem.id = res.id + '_' + p.id // #panelsetid_panelid

          panelHeaderItem.setAttribute('role', 'tab')

            'panel-tab-active',
            thisPanelIsActive

     * search parameters. If no panel is provided, it removes the panelset from

     * @param {string} [panelId] - The ID of the panel (optional).

      panelId,
      params = new URLSearchParams(window.location.search)

      return params

      if (typeof params === 'undefined') return
      params = params.toString() ? '?' + params.toString() : ''
      const { pathname, hash } = window.location
      const uri = pathname + params + hash
      window.history.replaceState(uri, '', uri)

     * @param {HTMLElement} clicked - The clicked element.
     */

      if (!panelset) return

     * moving to the next or previous panel via arrow keys, depending on the

     *
     * @param {HTMLElement} panelset - The panelset element.
     * @param {KeyboardEvent} ev - The keydown event.
     */

      function stopEvent () {
        ev.preventDefault()
        if (inRemarkjs() || inRevealjs()) {
          ev.stopPropagation()

        return

        inRemarkSlide(panelset) ||
        inRevealjs() ||
        panelset.getAttribute('aria-orientation') === 'horizontal'

        if (ev.code === 'ArrowRight') direction = 'next'

      const newActive = toggleSibling(panelset, target, direction)
      if (newActive) stopEvent()
      return newActive

     *
     * @param {HTMLElement} panelset - The panelset element.
     * @param {string} name - The name of the panel tab to find.

     * undefined if not found.

      const matches = Array.from(
        panelset.querySelectorAll(':scope > .panel-tabs > .panel-tab')
      ).filter(p => p.innerText.toLowerCase().trim() === name)

          `No panel with name "${name}" found in panelset ${panelset.id}`,
          { panelset, name }
        )
        return

      target.setAttribute('aria-selected', true)
      target.tabIndex = tabIndex

      Array.from(panels).forEach(p => {
        const isActive = p.id === targetPanelId
        p.classList.toggle('panel-active', isActive)
        p.hidden = !isActive
      })

      // emit window resize event to trick html widgets into fitting to the panel width
      window.dispatchEvent(new window.Event('resize'))

      if (['all', 'group'].includes(update) && panelset.dataset.group) {
        const group = panelset.dataset.group
        const panel = target.innerText.toLowerCase().trim()

        setStoredPanelGroupState(group, panel)

        panelset.dispatchEvent(
          new window.CustomEvent('panelset:group', {
            bubbles: true,
            detail: { group, panel }
          })
        )
      }

      // update query string
      if (['all', 'url'].includes(update)) {
        const params = updateSearchParams(panelset.id, targetPanelId)
        updateUrl(params)
      }
    }

    /**
     * Toggles the sibling panel in the specified direction.
     *
     * @param {HTMLElement} panelset - The panelset element.
     * @param {HTMLElement} target - The target panel element.
     * @param {"next" | "prev"} [direction="next"] - The direction to toggle the
     * sibling panel. Possible values are "next" and "prev".
     */
    function toggleSibling (panelset, target, direction = 'next') {
      let sibling
      switch (direction) {
        case 'next':
          sibling = target.nextSibling
          break
        case 'prev':
          sibling = target.previousSibling
          break
      }

      if (!sibling) return
      const update = parseInt(target.tabIndex) < 0 ? 'url' : 'all'
      togglePanel(panelset, sibling, update, target.tabIndex)
      sibling.focus()
      return sibling
    }

    /**
     * Initializes a panel set from the original markup into a full panelset.
     * This includes creating the panel tabs, rearranging content, adding event
     * listeners, and synchronizing with a panel set group.
     *
     * @param {HTMLElement} panelset - The `.panelset` element to initialize.
     * @returns {HTMLElement} - The new panelset element.
     */
    const initPanelSet = panelset => {
      let panels = Array.from(panelset.querySelectorAll(':scope > .panel, :scope > .cell > .panel'))

      const pandocSectionSelector = ':is(section, .section)[class*="level"]'
      if (!panels.length) {
        // we're in tabset-alike R Markdown or Quarto
        const getSectionLevel = el => {
          const levels = [...el.classList].filter(s => s.match(/^level/))
          return levels.length ? levels[0].replace('level', '') : levels
        }

        // {.panelset} applied to a section heading
        let panelsetLevel = getSectionLevel(panelset)

        if (!panelsetLevel.length) {
          // {.panelset} applied as a fenced div around subsections
          const subSections = panelset.querySelectorAll(pandocSectionSelector)
          if (!subSections.length) return

          panelsetLevel = Array.from(subSections)
            .map(getSectionLevel)
            .map(x => parseInt(x))
            .reduce((acc, x) => Math.min(acc, x), Infinity)

          panelsetLevel = +panelsetLevel - 1
        }

        // move children that aren't inside a section up above the panelset
        Array.from(panelset.children).forEach(function (el) {
          if (el.matches(pandocSectionSelector)) return
          panelset.parentElement.insertBefore(el, panelset)
        })

        // panels are all .sections with .level<panelsetLevel + 1>
        const panelLevel = +panelsetLevel + 1
        panels = Array.from(
          panelset.querySelectorAll(`:is(section, .section).level${panelLevel}`)
        )
      }

      if (!panels.length) return

      // create content panels
      const contents = panels.map(processPanelItem).filter(o => o !== null)

      // create panelset
      const panelsetAttrs = getElementAttributes(panelset)
      const newPanelSet = reflowPanelSet(contents, {
        id: panelset.id,
        ...panelsetAttrs
      })
      newPanelSet.classList = panelset.classList

      // set orientation
      const isVertical = panelset.matches(
        '.sideways, .vertical, [aria-orientation="vertical"]'
      )
      newPanelSet.setAttribute(
        'aria-orientation',
        isVertical ? 'vertical' : 'horizontal'
      )

      panelset.parentNode.insertBefore(newPanelSet, panelset)
      panelset.parentNode.removeChild(panelset)

      // click and touch events
      const panelTabs = newPanelSet.querySelector('.panel-tabs')
      ;['click', 'touchend'].forEach(eventType => {
        panelTabs.addEventListener(eventType, function (ev) {
          handleClickedPanel(ev.target)
          ev.stopPropagation()
        })
      })
      panelTabs.addEventListener('touchmove', function (ev) {
        ev.preventDefault()
      })

      // key events
      newPanelSet
        .querySelector('.panel-tabs')
        .addEventListener('keydown', ev => {
          handlePanelTabsKeydown(newPanelSet, ev)
        })

      // synchronize with the panelset group
      if (newPanelSet.dataset.group) {
        window.addEventListener('panelset:group', ev => {
          if (ev.target === newPanelSet) return
          if (ev.detail.group !== newPanelSet.dataset.group) return
          togglePanel(newPanelSet, ev.detail.panel, 'url')
        })

        const groupData = getStoredPanelSettings()
        const currentPanelFromUrl = getCurrentPanelFromUrl(newPanelSet.id)

        if (!currentPanelFromUrl && groupData[newPanelSet.dataset.group]) {
          togglePanel(newPanelSet, groupData[newPanelSet.dataset.group], null)
        }
      }

      return newPanelSet
    }

    const localStorageKey = 'panelset-data'

    /**
     * Retrieves or creates the stored panel settings from local storage.
     * @returns {{['string']: 'string'} | {}} The stored panel settings, as an
     * empty object or an object with group names as keys and the currently
     * activated panel names as values.
     */
    function getStoredPanelSettings () {
      const data = window.localStorage.getItem(localStorageKey)
      if (!data) {
        window.localStorage.setItem(localStorageKey, '{}')
        return {}
      }
      if (data) {
        return JSON.parse(data)
      }
    }

    function setStoredPanelSettings (data) {
      window.localStorage.setItem(localStorageKey, JSON.stringify(data))
    }

    /**
     * Sets the stored panel group state in local storage. The group `name` is
     * used as a key and is globally checked across pages in the same domain.
     *
     * @param {string} name - The name of the panel group.
     * @param {any} value - The value to set for the panel group.
     */
    function setStoredPanelGroupState (name, value) {
      const data = getStoredPanelSettings()
      data[name] = value
      setStoredPanelSettings(data)
    }

    // initialize panels
    document
      .querySelectorAll('[data-panelset="true"]')
      .forEach(el => {
        const isCell = el.classList.contains('cell')
        const hasParentPanelset = el.parentElement.classList.contains('panelset')
        if (!isCell || !hasParentPanelset) {
          // We let `data-panelset="true"` create a new panelset, unless it's on
          // a code cell that's already inside a panelset, in which case the
          // panels will be folded into the parent panelset.
          el.classList.add('panelset')
        }
      })

    const panelsets = { atomic: [], nested: [] }
    Array.from(document.querySelectorAll('.panelset')).forEach(el => {
      if (el.querySelector('.panelset')) {
        // push nested panelsets to the start of the list (inner -> outer)
        panelsets.nested.unshift(el)
      } else {
        // put panelsets without nested panelsets at the beginning
        panelsets.atomic.push(el)
      }
    })

    // initialize atomic panelsets first, then nested panelsets
    panelsets.atomic.forEach(initPanelSet)
    panelsets.nested.forEach(initPanelSet)

    if (inRemarkjs()) {
      const getVisibleActivePanelInfo = () => {
        const slidePanels = document.querySelectorAll(
          '.remark-visible .panel-tab-active'
        )

        if (!slidePanels.length) return null

        return slidePanels.map(panel => {
          return {
            panel,
            panelId: panel.children[0].getAttribute('aria-controls'),
            panelSetId: panel.parentNode.parentNode.id
          }
        })
      }

      slideshow.on('hideSlide', slide => {
        // clear focus if we had a panel-tab selected
        document.activeElement.blur()

        // clear search query for panelsets in current slide
        const params = [
          ...document.querySelectorAll('.remark-visible .panelset')
        ].reduce(function (params, panelset) {
          return updateSearchParams(panelset.id, null, params)
        }, new URLSearchParams(window.location.search))

        updateUrl(params)
      })

      slideshow.on('afterShowSlide', slide => {
        const slidePanels = getVisibleActivePanelInfo()

        if (slidePanels) {
          // only first panel gets focus
          slidePanels[0].panel.focus()
          // but still update the url to reflect all active panels
          const params = slidePanels.reduce(function (
            params,
            { panelId, panelSetId }
          ) {
            return updateSearchParams(panelSetId, panelId, params)
          },
          new URLSearchParams(window.location.search))
          updateUrl(params)
        }
      })
    }

    if (inRevealjs()) {
      window.Reveal.on('slidechanged', function ({ currentSlide, previousSlide, ...data }) {
        // clear focus from any active panel-tab in the previous slide
        const previousActive = previousSlide.querySelector('.panelset .panel-tab:focus')
        if (previousActive) {
          previousActive.blur()
          previousActive.removeAttribute('tabindex')
        }

        const previousPanelsets = previousSlide.querySelectorAll('.panelset')
        if (previousPanelsets.length) {
          // clear search query for panelsets in previous slide
          const params = [
            ...previousSlide.querySelectorAll('.panelset')
          ].reduce(function (params, panelset) {
            return updateSearchParams(panelset.id, null, params)
          }, new URLSearchParams(window.location.search))

          updateUrl(params)
        }

        const firstPanelset = currentSlide.querySelector('.panelset')
        if (!firstPanelset) return

        const panelIdFromUrl = getCurrentPanelFromUrl(firstPanelset.id)
        const panelFromUrl = !panelIdFromUrl
          ? null
          : firstPanelset
            .querySelector(`[aria-controls="${panelIdFromUrl}"]`)
            ?.parentElement

        const firstPanel = panelIdFromUrl
          ? panelFromUrl
          : firstPanelset.querySelector('.panel-tab-active')

        if (!firstPanel) return
        firstPanel.setAttribute('tabindex', '-1')
        firstPanel.focus()

        // update url for all panels on this slide
        const params = [
          ...currentSlide.querySelectorAll('.panelset')
        ].reduce(function (params, panelset) {
          return updateSearchParams(
            panelset.id,
            panelset.querySelector('.panel-active').id,
            params
          )
        }, new URLSearchParams(window.location.search))

        updateUrl(params)
      })
    }
  })
})()

:root {

--text-font-family: 'Source Sans Pro';
--text-font-is-google: 1;
--text-font-family-fallback: -apple-system, BlinkMacSystemFont, avenir next, avenir, helvetica neue, helvetica, Ubuntu, roboto, noto, segoe ui, arial;
--text-font-base: sans-serif;
--header-font-family: 'Source Sans Pro';
--header-font-is-google: 1;
--header-font-family-fallback: Georgia, serif;
--code-font-family: 'Source Code Pro';
--code-font-is-google: 1;
--base-font-size: 20px;
--text-font-size: 1rem;
--code-font-size: 0.9rem;
--code-inline-font-size: 1em;
--header-h1-font-size: 2.75rem;
--header-h2-font-size: 2.25rem;
--header-h3-font-size: 1.75rem;

--text-color: #272822;
--header-color: #000000;
--background-color: #FFFFFF;
--link-color: #0F4C81;
--text-bold-color: #0F4C81;
--code-highlight-color: rgba(255,255,0,0.5);
--inverse-text-color: #FFFFFF;
--inverse-background-color: #0F4C81;
--inverse-header-color: #FFFFFF;
--inverse-link-color: #0F4C81;
--title-slide-background-color: #0F4C81;
--title-slide-text-color: #FFFFFF;
--header-background-color: #000000;
--header-background-text-color: #FFFFFF;
--base: #0F4C81;
--white: #FFFFFF;
--black: #272822;
}
html {
font-size: var(--base-font-size);
}
body {
font-family: var(--text-font-family), var(--text-font-family-fallback), var(--text-font-base);
font-weight: 400;
color: var(--text-color);
}
h1, h2, h3 {
font-family: var(--header-font-family), var(--header-font-family-fallback);
font-weight: 400;
color: var(--header-color);
}
.remark-slide-content {
background-color: var(--background-color);
font-size: 1rem;
padding: 16px 64px 16px 64px;
width: 100%;
height: 100%;
}
.remark-slide-content h1 {
font-size: var(--header-h1-font-size);
}
.remark-slide-content h2 {
font-size: var(--header-h2-font-size);
}
.remark-slide-content h3 {
font-size: var(--header-h3-font-size);
}
.remark-code, .remark-inline-code {
font-family: var(--code-font-family), Menlo, Consolas, Monaco, Liberation Mono, Lucida Console, monospace;
}
.remark-code {
font-size: var(--code-font-size);
}
.remark-inline-code {
font-size: var(--code-inline-font-size);
color: #0F4C81;
}
.remark-slide-number {
color: #0F4C81;
opacity: 1;
font-size: 0.9rem;
}
strong {
font-weight: bold;
color: var(--text-bold-color);
}
a, a > code {
color: var(--link-color);
text-decoration: none;
}
.footnote {
position: absolute;
bottom: 60px;
padding-right: 4em;
font-size: 0.9em;
}
.remark-code-line-highlighted {
background-color: var(--code-highlight-color);
}
.inverse {
background-color: var(--inverse-background-color);
color: var(--inverse-text-color);
}
.inverse h1, .inverse h2, .inverse h3 {
color: var(--inverse-header-color);
}
.inverse a, .inverse a > code {
color: var(--inverse-link-color);
}
.title-slide, .title-slide h1, .title-slide h2, .title-slide h3 {
color: var(--title-slide-text-color);
}
.title-slide {
background-color: var(--title-slide-background-color);
}
.title-slide .remark-slide-number {
display: none;
}

.left-column {
width: 20%;
height: 92%;
float: left;
}
.left-column h2, .left-column h3 {
color: #0F4C8199;
}
.left-column h2:last-of-type, .left-column h3:last-child {
color: #0F4C81;
}
.right-column {
width: 75%;
float: right;
padding-top: 1em;
}
.pull-left {
float: left;
width: 47%;
}
.pull-right {
float: right;
width: 47%;
}
.pull-right + * {
clear: both;
}
img, video, iframe {
max-width: 100%;
}
blockquote {
border-left: solid 5px #0F4C8180;
padding-left: 1em;
}
.remark-slide table {
margin: auto;
border-top: 1px solid #666;
border-bottom: 1px solid #666;
}
.remark-slide table thead th {
border-bottom: 1px solid #ddd;
}
th, td {
padding: 5px;
}
.remark-slide table:not(.table-unshaded) thead,
.remark-slide table:not(.table-unshaded) tfoot,
.remark-slide table:not(.table-unshaded) tr:nth-child(even) {
background: #CFDBE5;
}
table.dataTable tbody {
background-color: var(--background-color);
color: var(--text-color);
}
table.dataTable.display tbody tr.odd {
background-color: var(--background-color);
}
table.dataTable.display tbody tr.even {
background-color: #CFDBE5;
}
table.dataTable.hover tbody tr:hover, table.dataTable.display tbody tr:hover {
background-color: rgba(255, 255, 255, 0.5);
}
.dataTables_wrapper .dataTables_length, .dataTables_wrapper .dataTables_filter, .dataTables_wrapper .dataTables_info, .dataTables_wrapper .dataTables_processing, .dataTables_wrapper .dataTables_paginate {
color: var(--text-color);
}
.dataTables_wrapper .dataTables_paginate .paginate_button {
color: var(--text-color) !important;
}

.remark-slide-content.left pre,
.remark-slide-content.center pre,
.remark-slide-content.right pre {
text-align: start;
width: max-content;
max-width: 100%;
}
.remark-slide-content.left pre,
.remark-slide-content.right pre {
min-width: 50%;
min-width: min(40ch, 100%);
}
.remark-slide-content.center pre {
min-width: 66%;
min-width: min(50ch, 100%);
}
.remark-slide-content.left pre {
margin-left: unset;
margin-right: auto;
}
.remark-slide-content.center pre {
margin-left: auto;
margin-right: auto;
}
.remark-slide-content.right pre {
margin-left: auto;
margin-right: unset;
}

.remark-slide-content.header_background > h1 {
display: block;
position: absolute;
top: 0;
left: 0;
width: 100%;
background: var(--header-background-color);
color: var(--header-background-text-color);
padding: 2rem 64px 1.5rem 64px;
margin-top: 0;
box-sizing: border-box;
}
.remark-slide-content.header_background {
padding-top: 7rem;
}
@page { margin: 0; }
@media print {
.remark-slide-scaler {
width: 100% !important;
height: 100% !important;
transform: scale(1) !important;
top: 0 !important;
left: 0 !important;
}
}
.base {
color: var(--base);
}
.bg-base {
background-color: var(--base);
}
.white {
color: var(--white);
}
.bg-white {
background-color: var(--white);
}
.black {
color: var(--black);

# Part A
## Introduction


---
# Setting

- We cannot afford to collect data for the full population

- Data are only collected on __one__ random sample of `\(n\)` individuals, where `\(n\)` = sample size

- After we have selected a sample at random, we know the measurements of the individuals in the sample.

- We are not interested in the individuals in the sample per se, but we collected data on them to __infer__ from the sample data some property of the wider population the sample came from.

- You may want to:

    **Goal A: Estimation**. Estimate a population parameter.  
    **Goal B: Hypothesis Testing**. Test whether a hypothesised parameter value is plausible.


---
# A. Estimation

If our goal is estimating a population mean, `\(\mu\)`

+ we use the average of the observations in the sample, `\(\bar x\)`, as the estimate

+ the precision of our estimate is measured by the standard error, telling the average distance of a sample mean from the population mean

+ a 95% (or 90% or 99%) __confidence interval__ gives us a range of plausible values for the population mean. This is:

`$$\left[ \bar x - t^* \cdot \frac{s}{\sqrt n},\ \ \bar x + t^* \cdot \frac{s}{\sqrt n} \right]$$`

.pull-left[
+ for a 95% CI, the values `\(-t^*\)` and `\(+t^*\)` are found as:

    ```
    qt(c(0.025, 0.975), df = n - 1)
    ```
]

.pull-right[
+ for a 90% CI, the values `\(-t^*\)` and `\(+t^*\)` are found as:

    ```
    qt(c(0.05, 0.95), df = n - 1)
    ```
]


---
# B. Testing

If our goal is testing a hypothesis, for example:
`$$H_0: \mu = \mu_0 \qquad \text{vs} \qquad H_1:\mu \neq \mu_0$$`

+ Compute a __test statistic__, measuring some sort of &quot;distance&quot; between the sample data and the null hypothesis.
    
&gt; __Definition: Test Statistic__  
&gt; A test statistic is any numerical quantity computed from the sample data with the purpose to make a test of some kind.
    
+ For testing a population mean, we use the __t-statistic__:
`$$t = \frac{\bar x - \mu_0}{SE} \qquad \text{where } \qquad SE = \frac{s}{\sqrt n}$$`

+ The t-statistic is the difference between the sample and hypothesised mean, divided by the variation in sample means due to random sampling.
    
+ When you will perform a test on categorical variables you will see a different type of test statistic (the chi-squared statistic).

# Part B
## P-values and Critical Values


---
# Thought experiment






.pull-left[
- Suppose I gave you a population __with a mean `\(\mu = 20\)`__:

    (21, 21, 18, 23, 21, 25, 16, 19, 17, 19, 21, 23, 19, 18, 19, 21, 20, 23, 19, 17)

- Take all possible samples of size `\(n = 4\)`.

- __For each sample:__

    - Compute the average of the `\(n = 4\)` numbers in the sample.

- Plot all the averages `\(\bar{x}\)`&#39;s using a histogram.

    + Centre?
    + Spread?
    
- The sample mean `\(\bar x\)` fluctuates from sample to sample around the population mean `\(\mu = 20\)`, and the typical distance from the true value is given by the SE.
]


.pull-right[
&lt;img src=&quot;data:image/png;base64,#dapr1_2_03_ht_critvalues_files/figure-html/unnamed-chunk-5-1.png&quot; width=&quot;100%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;
]


---
# Testing hypotheses

- Suppose we are testing
`$$H_0 : \mu = 20 \\ H_1 : \mu \neq 20$$`


- We can build a __test statistic__ to assess how much the sample data are consistent with the specified null hypothesis.

- The test statistic for testing a mean is the __t-statistic__ or __t-score__. In the example above, `\(\mu_0 = 20\)`:
`$$t = \frac{\bar x - 20}{s / \sqrt  n}$$`
- We can compute the t-statistic for the observed sample. But is this a surprising value or not?

- To decide this we need to ask ourselves: What are all the possible values of the t-statistic __when `\(H_0\)` is true__?

    + I.e., what is the distribution of the t-statistic __when `\(H_0\)` is true__? More formally, what is the __null distribution__?


???

So we can compute `\(t\)` for the observed sample. We don&#39;t know for the observed sample whether `\(H_0\)` or `\(H_1\)` is true, hence why we do the test.
What we can do however, is compute all the possible t-statistics when `\(H_0\)` is true, and see where the one from our observed sample is located. If it has low probability when `\(H_0\)` is true, then we should reject the null hypothesis.


---
# Thought experiment: Null distribution



.pull-left[
- Suppose I gave you a population __with a mean `\(\mu = 20\)`__:

    (21, 21, 18, 23, 21, 25, 16, 19, 17, 19, 21, 23, 19, 18, 19, 21, 20, 23, 19, 17)

- Take all possible samples of size `\(n = 4\)`.

- __For each sample:__
    
    - Compute the average `\(\bar{x}\)` of the `\(n=4\)` numbers in the sample.
    - Compute the SD `\(s\)` of the `\(n=4\)` numbers in the  sample.
    - Compute the t-statistic `\(t = \frac{\bar x - 20}{s / \sqrt{n}}\)` for that sample.

- Histogram of all t-statistics shows a distribution with more variability than a standard normal:
$$
t(n-1)
$$
]

.pull-right[
&lt;img src=&quot;data:image/png;base64,#dapr1_2_03_ht_critvalues_files/figure-html/unnamed-chunk-7-1.png&quot; width=&quot;100%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;
]

???

- Instead of computing the t-statistic on one sample only (the one sample we have collected), we can imagine doing this many many times for all possible random samples.

-  You know how to compute a t-score. You need to find the mean and SD of that sample, and do `\(t = \frac{\bar x - \mu_0}{s / \sqrt{n}}\)`. Now think about doing those steps repeatedly on many, many samples from the population. 


---
# Null distribution

- This thought-experiment shows us that the t-statistic, when the null hypothesis is true, follows a `\(t(n-1)\)` distribution.

`$$t = \frac{\bar{x} - \mu_0}{s / \sqrt{n}} \sim t(n-1)$$`

- Why only when `\(H_0\)` is true? Recall the previous example, in which the null hypothesis that `\(H_0: \mu = 20\)` was true.

- If that is the case, the sample means will fluctuate around 20. In turn, the distances of the sample means from 20, i.e. the t-scores, will fluctuate around 0.

- The null distribution shows us all the possible distances (t-statistics) between a sample mean and the hypothesised mean, when `\(H_0\)` is true.

- If our observed sample gives us a t-statistic that is unlikely / surprising when `\(H_0\)` is true, we start doubting the null hypothesis!

???

If H0 is true the sample means will scatter around 20. When you compute the distance of the means from 20, the distances will scatter around 0.

In fact, if `\(H_0\)` was true and the t-statistic from our observed sample was unlikely when `\(H_0\)` was true, it should have been very unlikely for us to obtained the observed sample in the first place.


---
# Example

.pull-left[
- Suppose you have collected data on one sample, with sample size `\(n = 4\)`. The sample data are:
`$$(32, 36, 26, 28)$$`

- We wish to test whether this sample comes from a population with a mean different from 20:
`$$H_0: \mu = 20 \qquad \text{vs} \qquad  H_1: \mu \neq 20$$`


``` r
data_sample &lt;- tibble(x = c(32, 36, 26, 28))
data_sample
```

```
## # A tibble: 4 Ã 1
##       x
##   &lt;dbl&gt;
## 1    32
## 2    36
## 3    26
## 4    28
```
]

.pull-right[

``` r
xbar &lt;- mean(data_sample$x)
xbar
```

```
## [1] 30.5
```


``` r
n &lt;- nrow(data_sample)
s &lt;- sd(data_sample$x)
se &lt;- s / sqrt(n)

mu0 &lt;- 20
tobs &lt;- (xbar - mu0) / se
tobs
```

```
## [1] 4.735
```
]


---
# P-value: Computation

.pull-left[
- We choose a significance level, `\(\alpha = 0.05\)` say.

- As `\(H_1\)` is two-sided, we compute the p-value as:


``` r
# Twice the area to the right of observed t
pvalue &lt;- 2 * pt(abs(tobs), df = n-1, 
                 lower.tail = FALSE)
pvalue
```

```
## [1] 0.01785
```

- This is the probability of observing a t-statistic having at least the same distance from 0 as the observed t-statistic, when `\(H_0\)` is true.

- An observed mean of 30 is as distant from 20 as 10 is. So both would be equally &quot;different&quot; from the hypothesised value, 20.

]

.pull-right[
&lt;img src=&quot;data:image/png;base64,#dapr1_2_03_ht_critvalues_files/figure-html/unnamed-chunk-12-1.png&quot; width=&quot;100%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;
]

???


Last week we learned to assess significance by computing the p-value.


---
# P-value: Making a decision

.pull-left[
- To make a decision on whether or not to reject `\(H_0\)` we need to compare the computed p-value with the chosen significance level of 5%.

- The p-value is 0.018, which is less than the chosen significance level, so we reject the null hypothesis.

- In doing so, we compared the _blue_ area, corresponding to the p-value, against the _red_ area, corresponding to the `\(\alpha = 0.05\)` significance level.

- Recall that the `\(\alpha = 0.05\)` probability is equally divided among the two tails in this case, because the alternative hypothesis is two-sided.

]

.pull-right[
&lt;img src=&quot;data:image/png;base64,#dapr1_2_03_ht_critvalues_files/figure-html/unnamed-chunk-13-1.png&quot; width=&quot;100%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;
]


---
# Equivalent approach: Critical values


.pull-left[
- Rather than comparing the area of `\(\alpha\)` (0.05, in red) to the area of the p-value (0.018, in blue), we can compare the corresponding t-statistics along the x-axis.

- The p-value is computed using the observed t-statistic, `\(t_{obs}\)` = 4.74.

- The t values that cut an area of 0.025 to the left and 0.025 to the right are called the __critical values__ for `\(\alpha = 0.05\)`, denoted `\(-t^*\)` and `\(+t^*\)`:


``` r
qt(c(0.025, 0.975), df = n-1)
```

```
## [1] -3.182  3.182
```

- We reject `\(H_0\)` when either `\(t_{obs} \leq -t^*\)` or `\(t_{obs} \geq +t^*\)`.
]

.pull-right[
&lt;img src=&quot;data:image/png;base64,#dapr1_2_03_ht_critvalues_files/figure-html/unnamed-chunk-15-1.png&quot; width=&quot;100%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

]


???

- In this case, `\(t =\)` 4.74 is larger than the upper critical value, `\(t^* =\)` 3.18.


---
# Example 2

- Suppose now that the collected sample, with sample size `\(n = 4\)`, was:
`$$(18, 21, 19, 23)$$`

- We wish to test whether this sample comes from a population with a mean different from 20:
`$$H_0: \mu = 20 \\ H_1: \mu \neq 20$$`


``` r
data_sample2 &lt;- tibble(x = c(18, 21, 19, 23))
data_sample2
```

```
## # A tibble: 4 Ã 1
##       x
##   &lt;dbl&gt;
## 1    18
## 2    21
## 3    19
## 4    23
```


---
# Example 2



``` r
xbar &lt;- mean(data_sample2$x)
xbar
```

```
## [1] 20.25
```


``` r
n &lt;- nrow(data_sample2)
s &lt;- sd(data_sample2$x)
se &lt;- s / sqrt(n)

mu0 &lt;- 20
tobs &lt;- (xbar - mu0) / se
tobs
```

```

```


---
# Example 2

.pull-left[
- Critical values for a `\(t(n-1)\)` distribution with `\(\alpha = 0.05\)`


``` r
tstar &lt;- qt(c(0.025, 0.975), df = n-1)
tstar
```

```
## [1] -3.182  3.182
```

- Is the observed `\(t_{obs} =\)` 0.23 smaller than or equal to the lower critical value? _No!_
- Is the observed `\(t_{obs} =\)` 0.23 greater than or equal to the upper critical value? _No!_


``` r
tobs &lt;= tstar[1]
```

```
## [1] FALSE
```

``` r
tobs &gt;= tstar[2]
```

```
## [1] FALSE
```

]


.pull-right[
&lt;img src=&quot;data:image/png;base64,#dapr1_2_03_ht_critvalues_files/figure-html/unnamed-chunk-21-1.png&quot; width=&quot;100%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

]

---
# Example 2

- As our observed t-statistic lies in between the two critical values, rather than beyond, it lies in the middle 95% of the null distribution.

- If you were to compute the p-value for `\(t\)`, it would be larger than `\(\alpha\)`, which is the area beyond the critical values `\(\pm t^*\)`.

- We do not have sufficient evidence to reject `\(H_0\)` at the 5% significance level.

# Part C
## Body temperature example


---
# Body temperature example

&gt; Has the average body temperature for healthy humans changed from the long-thought 37 Â°C? 

- We are testing:

`$$H_0: \mu = 37 \qquad \text{vs} \qquad H_1: \mu \neq 37$$`

--

- Read the data:


``` r
library(tidyverse)
tempsample &lt;- read_csv(&#39;https://uoepsy.github.io/data/BodyTemperatures.csv&#39;)
tempsample &lt;- tempsample |&gt; 
    drop_na(BodyTemp)
glimpse(tempsample)
```

```
## Rows: 50
## Columns: 2
## $ BodyTemp &lt;dbl&gt; 36.44, 37.44, 37.22, 37.11, 36.67, 37.17, 37.22, 36.56, 36.00â¦
## $ Pulse    &lt;dbl&gt; 69, 77, 75, 84, 71, 76, 81, 77, 75, 81, NA, 78, 71, 80, 70, 7â¦
```


---
# Body temperature example


``` r
xbar &lt;- mean(tempsample$BodyTemp)
xbar
```

```
## [1] 36.81
```

--

- The observed t-statistic: `\(t = \frac{\bar x - \mu_0}{s / \sqrt{n}}\)`


``` r
n &lt;- nrow(tempsample)
n
```

```
## [1] 50
```

``` r
s &lt;- sd(tempsample$BodyTemp)
SE &lt;- s / sqrt(n)

mu0 &lt;- 37
tobs &lt;- (xbar - mu0) / SE
tobs
```

```
## [1] -3.141
```


---
# Body temperature example

- The observed t-statistic is `\(t_{obs}\)` = -3.14.

--

- Compute the critical values of a t(49) distribution with `\(\alpha = 0.05\)`:


``` r
qt(c(0.025, 0.975), df = n - 1)
```

```
## [1] -2.01  2.01
```

--

- The observed t-statistic lies beyond the critical values, and as such falls in the 5% probability tails of the null distribution.

--

- We reject the null hypothesis as the observed t-statistic is unlikely to be obtained if the null hypothesis were true.

--

- In terms of reporting, when the observed `\(t\)` is beyond the critical values, `\(p &lt; \alpha\)`. Otherwise, `\(p &gt; \alpha\)`.

--

Example:

&gt; At the 5% significance level, we performed a two-sided hypothesis test against the null hypothesis that the mean body temperature for all healthy humans is equal to 37 Â°C.  
&gt; As the observed t-statistics lies beyond the critical values, the sample results provide strong evidence against the null hypothesis and in favour of the alternative one that the average body temperature differs from 37 Â°C; `\(t(49) = -3.14, p &lt; .05\)`, two-sided.
